function escapeHtml(str) {
    const htmlEntities = {
        '&': '&amp;',
        '<': '&lt;',
        '>': '&gt;',
        '\"': '&quot;',
        '\'': '&#x27;',
        '/': '&#x2F;'
    };
    return str.replace(/[&<>"'/]/g, function (match) {
        return htmlEntities[match];
    });
}


