function changeOnInput(lable, input, defaultInput = '') {
    if ($(input).val() === '') {
        $(lable).html(defaultInput);
    }
    else {
        $(lable).html(escapeHtml($(input).val()));
    }
    $(input).on("input", function () {
        if ($(this).val() != "") {
            $(lable).html(escapeHtml($(this).val()));
        } else {
            $(lable).html(defaultInput);
        }

    });
}

